-- Volcando estructura para procedimiento ecommerce.sp_admin_login
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_admin_login`(
	IN `email` VARCHAR(50),
	IN `pwd` VARCHAR(50)

)
BEGIN
SELECT id, nombre, email, foto, password as pwd, id_tipo_perfil, estado, fecha FROM `ecommerce`.`administradores` WHERE administradores.email=email and administradores.password=pwd and administradores.estado=1;
END//
DELIMITER ;

