-- Volcando estructura para procedimiento ecommerce.sp_productos_consulta
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_productos_consulta`(
	IN `ordenar` VARCHAR(30)


)
BEGIN
declare tipo varchar(30);
set tipo=ordenar;

case tipo
when 'id' then select * from productos where precio=0 order by id desc limit 4;
when 'ventas' then select * from productos order by ventas desc limit 4;
when 'vistas' then select * from productos order by vistas  desc limit 4;

else
begin
end;
end case;


END//
DELIMITER ;

